    <Router>
      <Routes>
        <Route path="/login" element={<LoginForm />} />
        <Route path="/" element={<Dashboard />} />
        {/* Redirect to login page if route doesn't match */}
        {/* <Navigate to="/login" /> */}
      </Routes>
    </Router>
  );
}

export default App;
